import React from "react";
import { useFormik } from 'formik';

function App() {
  const formik = useFormik({
    initialValues: {
      email: '',
      password: ''
    },
    onSubmit: values => {
      console.log(values);
    },
    validate: values => {
      let errors = {};
      if(!values.email) errors.email = 'Field required';
      if(!values.password) errors.password = 'Field required';
      if(values.email == ``) ;
      return errors;
    }
  })

  return (
    <div>
      <form onSubmit={formik.handleSubmit}>
        <div>Email</div>
        <input id="emailField" type="text" onChange={formik.handleChange}
        value={formik.values.emailField}></input>
        <div>Password</div>
        <input id="pswField" type="password" onChange={formik.handleChange}
        value={formik.values.pswField}></input>
        <div><button id="submitBtn">Submit</button></div>
      </form>
    </div>
  );
}

export default App;
